function ChartBar(props){
    let height='0%';
    if(props.value>0){
        height=Math.round(((props.value)/props.maxValue)*100) +'%';
    }
    return <div>
        <div style={{height:height}}>
        </div>
        <div>
            <label>{props.title}</label>
        </div>

    </div>
};
export default ChartBar;
